} async function robustDocumentCreate(configPath, content) { let agent; try { agent = new JacsAgent(); await agent.load(configPath); } catch (error) { throw new JacsError( 'Failed to initialize JACS agent', 'INIT_ERROR', { originalError: error.message } ); } try { const signedDoc = await agent.createDocument(JSON.stringify(content)); return JSON.parse(signedDoc); } catch (error) { throw new JacsError( 'Failed to create document', 'CREATE_ERROR', { originalError: error.message, content } ); }
