Track and verify document history with cryptographic proofs. // audit-trail.js
import { JacsAgent } from '@hai.ai/jacs';
import fs from 'fs';
import path from 'path'; class AuditTrailSystem { constructor(configPath, auditDir = './audit') { this.configPath = configPath; this.auditDir = auditDir; this.agent = null; } async initialize() { this.agent = new JacsAgent(); await this.agent.load(this.configPath); if (!fs.existsSync(this.auditDir)) { fs.mkdirSync(this.auditDir, { recursive: true }); } } async createDocument(content, metadata = {}) { const auditEntry = { action: 'create', timestamp: new Date().toISOString(), content, metadata }; const signedDoc = await this.agent.createDocument( JSON.stringify({ ...content, _audit: auditEntry }) ); const doc = JSON.parse(signedDoc); // Save to audit log await this.logAuditEntry(doc.jacsId, 'create', doc); return doc; } async updateDocument(originalDoc, newContent, metadata = {}) { const auditEntry = { action: 'update', timestamp: new Date().toISOString(), previousVersion: originalDoc.jacsVersion, changes: this.computeChanges(originalDoc, newContent), metadata }; const updatedDoc = await this.agent.updateDocument( JSON.stringify(originalDoc), JSON.stringify({ ...newContent, _audit: auditEntry }) ); const doc = JSON.parse(updatedDoc); // Save to audit log await this.logAuditEntry(doc.jacsId, 'update', doc); return doc; } computeChanges(original, updated) { const changes = []; for (const [key, value] of Object.entries(updated)) { if (key.startsWith('_')) continue; if (!(key in original)) { changes.push({ field: key, type: 'added', newValue: value }); } else if (JSON.stringify(original[key]) !== JSON.stringify(value)) { changes.push({ field: key, type: 'modified', oldValue: original[key], newValue: value }); } } for (const key of Object.keys(original)) { if (key.startsWith('_') || key.startsWith('jacs')) continue; if (!(key in updated)) { changes.push({ field: key, type: 'removed', oldValue: original[key] }); } } return changes; } async logAuditEntry(documentId, action, document) { const logFile = path.join(this.auditDir, `${documentId}.audit.jsonl`); const entry = { timestamp: new Date().toISOString(), action, documentId, version: document.jacsVersion, signature: document.jacsSignature, hash: document.jacsSha256 }; fs.appendFileSync(logFile, JSON.stringify(entry) + '\n'); } async getAuditTrail(documentId) { const logFile = path.join(this.auditDir, `${documentId}.audit.jsonl`); if (!fs.existsSync(logFile)) { return []; } const lines = fs.readFileSync(logFile, 'utf-8').trim().split('\n'); return lines.map(line => JSON.parse(line)); } async verifyAuditTrail(documentId) { const trail = await this.getAuditTrail(documentId); const results = []; for (const entry of trail) { // Load and verify each version const docPath = path.join( this.auditDir, 'documents', documentId, `${entry.version}.json` ); if (fs.existsSync(docPath)) { const docString = fs.readFileSync(docPath, 'utf-8'); const isValid = await this.agent.verifyDocument(docString); results.push({ version: entry.version, timestamp: entry.timestamp, action: entry.action, valid: isValid }); } else { results.push({ version: entry.version, timestamp: entry.timestamp, action: entry.action, valid: null, error: 'Document file not found' }); } } return results; }
} // Usage
async function runAuditExample() { const audit = new AuditTrailSystem('./jacs.config.json'); await audit.initialize(); // Create a document const doc = await audit.createDocument({ type: 'financial_report', period: 'Q1 2024', revenue: 1000000, expenses: 750000 }, { author: 'Finance Team' }); console.log('Created document:', doc.jacsId); // Update the document const updated = await audit.updateDocument(doc, { type: 'financial_report', period: 'Q1 2024', revenue: 1000000, expenses: 750000, profit: 250000, // Added field status: 'approved' }, { author: 'CFO', reason: 'Added profit calculation' }); console.log('Updated to version:', updated.jacsVersion); // Get audit trail const trail = await audit.getAuditTrail(doc.jacsId); console.log('Audit trail:'); for (const entry of trail) { console.log(` ${entry.timestamp} - ${entry.action} (v${entry.version})`); }
} runAuditExample().catch(console.error);

